        System.out.println(name + " is stalking " + target);
        System.out.println("Enter 'q' to quit or 's' to send a message:");

        Scanner scanner = new Scanner(System.in);
        char choice = scanner.next().charAt(0);

        while (choice != 'q') {
            if (choice == 's') {
                System.out.print("Enter message: ");
                String message = scanner.nextLine();
                sendMessage(message);
            }

            System.out.println("Enter 'q' to quit or 's' to send a message:");
            choice = scanner.next().charAt(0);
        }

        System.out.println(name + " has stopped stalking " + target);
    }

    private void sendMessage(String message) {
        System.out.println(name + " sent a message to " + target + ": " + message);
    }

    public static void main(String[] args) {
        Stalker stalker = new Stalker("John Doe", "Jane Doe");
        stalker.stalk();
    }
}
